import React from 'react';

function ProjectList() {
  return (
    <React.Fragment>
    <div className="projectList">
    ProjectList
    </div>
    <section id="projects">
    <div class="container">
      <div class="project-wrapper">
        <h2 class="section-title dark-blue-text">
          Projects
        </h2>
        <Project/>

        </div>
      </div>
    </section>
    </React.Fragment>
  );
}
export default ProjectList;
